import React from 'react';
import { Menu } from 'antd';
import { Link } from 'react-router-dom';
import {
  TeamOutlined,
  BarChartOutlined,
} from '@ant-design/icons';
import { Data } from "../data";
import logoUrl from '../assets/static/logo-dark.png';
import '../assets/styles/header.css';

const { SubMenu } = Menu;

function NavSider({setView, viewSelect}) {
  const handleView = ({ key }) => {
    console.log(key);
    setView(key);
    // setViewSelect([key]);
    }

    return (
        <>
        <div className="logo">
          <a  href="https://techstars.com">
          <img src={logoUrl} alt="techstarts icon" />
          </a>
        </div>
        <Menu theme='dark' selectedKeys={viewSelect} mode="inline" onClick={handleView}>
            <SubMenu key="sub2" title="Mentors" icon={<TeamOutlined/>}>
            {
              Data.map((mentor)=>
                  {return Object.values(mentor.Slots).map((sub, i)=>
                    {return(sub ?
                      <Menu.Item key={i} company={sub.Slots} icon={<BarChartOutlined  />}>
                        <Link to='/Dashboard'>{company.sub}</Link>
                      </Menu.Item>
                        : <></>
                    )}
                  )}
              )
            }
              <Menu.Item key="1" icon={<BarChartOutlined  />}>
                <Link to='/Dashboard'>Dashboard</Link>
              </Menu.Item>
            </SubMenu>
        </Menu>
        </>
    )
}
export default NavSider;
